import './styles.css';
import { SideBarHeader } from './components/SideBarHeader';
import { SideBarList } from './components/SideBarList';
import { SideBarFooter } from './components/SideBarList';

const App: React.FC = () => {
  console.log("Let's get started!")

  return (
    <div className='main'>
      <SideBarHeader title='coinbase'/>
      <SideBarList />
      <SideBarFooter />
    </div>
  );
};

export default App;
